  function randomColor() {
    var letters = "0123456789ABCDEF";
    var color = "#";
  
    for (var i = 0; i < 6; i++) {
      color += letters[Math.floor(Math.random() * 16)];
    }
    return color;
  }
  
  var width = 1500,
    height = 1200,
    duration = 750,
    initial_scale = 3,
    radius = 15;
  var nodes = {};
  var links, path, zoomable_layer;
  
  links = json_data.children;
  
  links.forEach(function (link) {
    link.source =
      nodes[link.source] ||
      (nodes[link.source] = {
        name: link.source_label,
        size: link.size,
        type: "source",
        institution: link.institution
      });
    link.target =
      nodes[link.target] ||
      (nodes[link.target] = {
        name: link.target_label,
        size: link.size,
        type: "target"
      });
  });
  
  //Function to center node when clicked/dropped so node doesn't get lost when collapsing/moving with large amount of children.
  function centerNode(source) {
    var scale = zoomListener.scaleLinear();
    x = -source.y0;
    y = -source.x0;
    x = (x * scale + width) / 2;
    y = (y * scale + height) / 2;
    d3.select("g")
      .transition()
      .duration(duration)
      .attr("transform", "translate(" + x + "," + y + ")scale(" + scale + ")");
    zoomListener.scale(scale);
    zoomListener.translate([x, y]);
  }
  
  function centering(source_event) {
    var newX = width - source_event.x;
    var newY = height - source_event.y;
    var newK = source_event.k;
  
    return { k: newK, x: newX, y: newY };
  }
  
  var fLinks = d3.forceLink(links);
  fLinks.distance(50);
  var force = d3
    .forceSimulation()
    .nodes(d3.values(nodes))
    .force("link", fLinks)
    .force("charge", d3.forceManyBody().strength(-200))
    //.force("collide", d3.forceCollide())
    //.force("center", d3.forceCenter(width/2, height/2))
    .on("tick", tick);
  
  //scaleExtent([1, 10]).
  var zoomListener = d3
    .zoom()
    .scaleExtent([0.8, Infinity])
    .on("zoom", function () {
      console.log(d3.event.transform);
      return zoomable_layer.attr(
        "transform",
        d3.event.transform.translate(width / 2, height / 2)
      );
    });
  
  var svg = d3
    .select("#myGraph")
    .append("svg")
    .attr("width", width)
    .attr("height", height)
    .attr("class", "bg")
    .call(zoomListener)
    .on("wheel", function () {
      d3.event.preventDefault();
    });
  
  var zoomable_layer = svg
    .append("g")
    .attr(
      "transform",
      "translate(" +
        width / 2 +
        ", " +
        height / 2 +
        ") scale(" +
        initial_scale +
        "," +
        initial_scale +
        ")"
    );
  
  var link = zoomable_layer
    .attr("class", "links")
    .selectAll("path")
    .data(links)
    .enter()
    .append("svg:path")
    .attr("stroke-width", function (d) {
      return 1;
    })
    .attr("class", function (d) {
      return "link " + d.st;
    })
    .attr("id", function (d, i) {
      return "linkId_" + i;
    })
    .attr("marker-end", function (d) {
      return "url(#" + d.st + ")";
    })
    .style("fill", "none")
    .style("stroke", "light-gray")
    .style("stroke-width", function (d) {
      return Math.log(d.rel_count + 1) + "px";
    });
  
  var linktext = zoomable_layer.selectAll("linklabel").data(links);
  linktext
    .enter()
    .append("text")
    .attr("class", "linklabel")
    .attr("x", function (d) {
      return "2vw";
    })
    .attr("text-anchor", "middle")
    .append("textPath")
    .attr("href", function (d, i) {
      return "#linkId_" + i;
    })
    .text(function (d) {
      return d.rel_count;
    });
  
  var node = zoomable_layer //.append('g')
    .attr("class", "nodes")
    .attr("height", height)
    .attr("width", width)
    .selectAll("g")
    .data(d3.values(nodes))
    .enter()
    .append("g")
    .style("transform-origin", "50% 50%")
    .call(
      d3.drag().on("start", dragstarted).on("drag", dragged).on("end", dragended)
    );
  node
    .append("circle")
    .attr("class", function (d) {
      return d.type;
    })
    .attr("r", radius)
    .style("fill", function (d) {
      return d.institution || randomColor();
    })
    .style("stroke-width", ".5px")
    .style("stroke", "ghostwhite")
    .attr("id", function (d) {
      return d.id;
    });
  
  node
    .append("text")
    .attr("dy", ".35em")
    .attr("class", "nodelabel")
    .attr("text-anchor", "middle")
    .text(function (d) {
      return d.name;
    });
  
  function tick() {
    node.attr("transform", transform);
    link.attr("d", linkArc);
  }
  
  function transform(d) {
    var x = Math.max(radius, Math.min(width - radius, d.x));
    var y = Math.max(radius, Math.min(height - radius, d.y));
    return "translate(" + d.x + "," + d.y + ")";
  }
  
  function linkArc(d) {
    var dx = d.target.x - d.source.x,
      dy = d.target.y - d.source.y,
      dr = Math.sqrt(dx * dx + dy * dy);
    //return "M" + d.source.x + "," + d.source.y + "A" + dr + "," + dr + " 0 0,1 " + d.target.x + "," + d.target.y;
    return (
      "M" + d.source.x + "," + d.source.y + "L" + d.target.x + "," + d.target.y
    );
  }
  
  function dragstarted(d) {
    if (!d3.event.active) force.alphaTarget(0.3).restart();
    d.fx = d.x;
    d.fy = d.y;
  }
  
  function dragged(d) {
    d.fx = d3.event.x;
    d.fy = d3.event.y;
  }
  
  function dragended(d) {
    if (!d3.event.active) force.alphaTarget(0);
    d.fx = null;
    d.fy = null;
  }
  